''' {{lj|野崎つばた}}'''是日本的插畫家、漫画家。

== 简介 ==

*千葉縣出身。現居京都府。暱稱為豆芽。
*2015年連載的漫畫《Bad∞End∞Night Insane Party》為其代表作。
